control.onUpdate:
if (text == "NEW") {
    ee.setText(sender, "<font color = '#d03030'>新增</font>");
} else if (text == "SND") {
    ee.setText(sender, "<font color = '#30d030'>已发货</font>");
} else {
    ee.setText(sender, text);
}

if (text == "") {
    ee.setText(sender, "");
    return;
}
var id = g5.dataset1.getData(16, sender.rowIndex);
text = "<font color = '#d03030'>(ID:" + id + ")</font>" + text;
ee.setText(sender, text);

if (text == "") {
    if (eb.isEmpty(g5.dataset1)) {
        ee.setText(sender, "");
        return;
    }
    if (sender.rowIndex >= g5.dataset1.rowCount) {
        ee.setText(sender, "");
        return;
    }
    ee.setText(sender, "人工下单");
    return;
}
var id = g5.dataset1.getData(15, sender.rowIndex);
text = "<font color = '#d03030'>(ID:" + id + ")</font>" + text;
ee.setText(sender, text);

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(product.displayName like '%" + db.encode(searchText) + "%') or " +
        "(link.name like '%" + db.encode(searchText) + "%') or " +
        "(link.url like '%" + db.encode(searchText) + "%') or " +
        "([order].name like '%" + db.encode(searchText) + "%') or " +
        "([order].address like '%" + db.encode(searchText) + "%') or " +
        "([order].mobile like '%" + db.encode(searchText) + "%') or " +
        "([order].expressName like '%" + db.encode(searchText) + "%') or " +
        "([order].expressCode like '%" + db.encode(searchText) + "%') or " +
        "([order].note like '%" + db.encode(searchText) + "%')) ";
}

sql =
    "SELECT count(*) as c " +
    "FROM dbo.[order] LEFT OUTER JOIN " +
    "      dbo.product ON dbo.[order].productId = dbo.product.id LEFT OUTER JOIN " +
    "      dbo.link ON dbo.[order].channelId = dbo.link.id " +
    "WHERE dbo.product.companyId=" + companyId + " " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT dbo.[order].id, dbo.[order].regDatetime, dbo.[order].status, " +
    "      dbo.product.displayName, dbo.link.name AS linkName, dbo.[order].name, " +
    "      dbo.[order].address1 + ' ' + dbo.[order].address2 + ' ' + dbo.[order].address3 + ' ' + dbo.[order].address as [address], " +
    "      dbo.[order].mobile, dbo.[order].orderCount, " + 
    "      dbo.[order].purchasePrice, dbo.[order].expressName, dbo.[order].expressCode, " + 
    "      dbo.[order].expressTime, dbo.[order].note, dbo.link.url, dbo.link.id AS linkId, " + 
    "      dbo.product.id AS productId " +
    "FROM dbo.[order] LEFT OUTER JOIN " +
    "      dbo.product ON dbo.[order].productId = dbo.product.id LEFT OUTER JOIN " +
    "      dbo.link ON dbo.[order].channelId = dbo.link.id " +
    "WHERE dbo.product.companyId=" + companyId + " " + condition +
    "ORDER BY id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,status,displayName,linkName,name,address,mobile," +
    "orderCount,purchasePrice,expressName,expressCode,expressTime,note,url,linkId,productId",
    pageSize*(pageCurrent-1), pageSize);

